MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre verification applications assist you in checking the physical and electrical integrity of IC designs. The tools discussed in this manual consist of Calibre nmDRC, Calibre nmDRC‑H, Calibre nmLVS, Calibre nmLVS-H, and some related utilities.");
MGCAddSnippet(6, "The CalibrenmDRC and CalibrenmDRC-H tools perform design rule checking of integrated circuit layout designs. This tool set can also be used for auxiliary layout generation tasks.");
MGCAddSnippet(7, "The Calibre tool set includes some utility programs that enhance the productivity of the tools.");
MGCAddSnippet(8, "The Calibre nmLVS and Calibre nmLVS-H tools extract layout netlists and compare a layout to a schematic netlist. Connectivity extraction functions in flat, hierarchical, and multithreaded (MT and MTflex) configurations. Connectivity extraction supports device recognition, short isolation, electrical rule checking (ERC), soft-connection checking, and SPICE circuit extraction. Circuit comparison functions in flat and hierarchical configurations. ");
MGCAddSnippet(9, "Many Calibre tools are useful in the Physical Verification process. Refer to the related documentation for more information. ");
MGCAddSnippet(10, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(11, "Calibre nmDRC and Calibre nmLVS require rule file and design database inputs in certain formats in order to perform verification tasks. The command lines for these tools have a large set of options for configuring the runs.");
MGCAddSnippet(12, "Before you invoke a Calibre Physical Verification tool, certain files must exist.");
MGCAddSnippet(13, "Calibre rule files are written in the Standard Verification Rule Format (SVRF) or in Tcl Verification Format (TVF). Typical practice is to use separate rule files for separate verification tools, but this is not required.");
MGCAddSnippet(14, "A layout database contains the physical description of a circuit. The Calibre tools support a number of input database formats. ");
MGCAddSnippet(15, "A source database contains the original source reference information of a circuit for LVS applications. This is also called a schematic netlist or source netlist. The source file is compared to the layout during an LVS (layout versus schematic) run.");
MGCAddSnippet(16, "Performs flat or hierarchical design rule checking.");
MGCAddSnippet(17, "Performs flat and hierarchical LVS circuit extraction and comparison.  Many LVS command line options are also relevant to Calibre PERC, where the behavior is occasionally somewhat different than in LVS. See the Calibre PERC User s Manual for details.");
MGCAddSnippet(18, "Performs stand-alone hierarchical ERC, Sconnect stamping violation (soft connection), and short isolation checks on the layout using a rule file or a Mask SVDB Directory.  The command line options for multithreading have essentially the same semantics as for LVS. Those options are fully described under the LVS command line section with just the differences discussed in detail here.");
MGCAddSnippet(19, "The Calibre Cell/Block license package provides interactive block verification to customers using layout editors. Note it is not a separate tool, but a license package that enables some of the Calibre applications described previously.");
MGCAddSnippet(20, "You can use the -version command line option to view the software version. The header of a Calibre run transcript also shows the software version.");
MGCAddSnippet(21, "Layout designs consist of shapes, which are, in turn, comprised of edges. Calibre tools work primarily with edges. Edges always have a reference back to the polygon to which they belong. Polygons and edges can also have a reference to an electrical node as long as you have established the appropriate layer connectivity in the rule file. ");
MGCAddSnippet(22, "A geometric layout database consists of layers corresponding to materials used in chip manufacturing. The layers contain various objects like polygons, paths, text objects, and properties. There are four types of layers that Calibre tools process.");
MGCAddSnippet(23, "Original layers (or drawn layers) are layers that represent original layout data. Original layers have assigned numbers, datatypes, and texttypes. In a rule file, layers may be referenced by numbers, but more frequently the numbers are mapped to names by using Layer statements. ");
MGCAddSnippet(24, "Derived layers are layers produced by layer operations in the rule file. Layer definitions assign names to derived layers. When a layer definition names a derived layer, you can use the derived layer in another rule file operation by referencing the layer s name. ");
MGCAddSnippet(25, "Derived polygon layers represent merged polygons generated as the output of Boolean layer operations, topological polygon operations, and certain dimensional check operations that employ polygon output. ");
MGCAddSnippet(26, "Derived edge layers represent edges or edge segments of merged polygons generated as the output of layer operations, such as topological edge operations or edge-directed dimensional check operations. Derived edge layers can also produce results output if they occur in a free-standing layer operation. ");
MGCAddSnippet(27, "Derived error layers represent clusters of one, two, three, or four edges from either one or two layers. Primarily, they hold output of error-directed layer operations for instantiation into the DRC results database; although other results databases can output derived error layers as well.");
MGCAddSnippet(28, "Several layer operations generate unmerged polygon layers or support unmerged derived polygon layers as input to the operation. This is not true for most layer operations. ");
MGCAddSnippet(29, "To summarize, derived polygon and derived edge layers can be used as output to the DRC results database or in layer definitions that are used for further processing in other layer operations. ");
MGCAddSnippet(30, "The basic unit within a Calibre rule file is the layer operation. A layer operation is any function that creates a derived layer from input consisting of original layers or other derived layers. ");
MGCAddSnippet(31, "Layer operations that generate derived edge or polygon layers are either layer constructors or layer selectors. The following sections describe these layer classifications. ");
MGCAddSnippet(32, "The connectivity model for the design is constructed in a single step before any operation that requires or passes connectivity. (DRC Incremental Connect YES changes this behavior in DRC). The connectivity model is built from all Connect and Sconnect statements in the rule file. From this initial connectivity model, node IDs can be passed to derived layers through node-preserving layer operations. ");
MGCAddSnippet(33, "Given the name X of a layer definition, an arbitrarily long sequence of operations may have produced it. The layer of origin of X is the last layer produced by a layer constructor from which data within X were derived. ");
MGCAddSnippet(34, "Flat verification applications work from a flat database representation only. For geometric layout input, flat Calibre tools expand the layout database to the top level at the start of a run and maintain no record of the original database hierarchy. Hierarchical database construction on the other hand leverages the hierarchy of the original design.");
MGCAddSnippet(35, "Certain specification statements only apply when the layout design has hierarchy. Such statements are ignored when the tool is run flat.");
MGCAddSnippet(36, "Input layout data is pre-processed by the Calibre tools to optimize performance and results debugging efficiency. Some of the pre-processing is automatic, and a user has no control over it. Other pre-processing steps can be specified in the rule file.");
MGCAddSnippet(37, "Area-based filtering of the layout constrains the output of the tool to particular regions of the design.");
MGCAddSnippet(38, "All hierarchical Calibre applications have the capability of excluding one or more layout database cells from processing. This is important in excluding alignment markers, trademarks, memory cores, and so forth. Excluding a cell means that no objects from any placement of the cell is processed by the application; this includes all hierarchy within the placement.");
MGCAddSnippet(39, "You may rename cells as the input layout database is being read. This is especially useful in establishing cell correspondences for dual-database capability in hierarchical applications.");
MGCAddSnippet(40, "By default, duplicate layout cells are not allowed. This condition causes a runtime error.");
MGCAddSnippet(41, "A layout database that originates from a module generation program may often contain large numbers of overlapping shapes on a single layer within each cell. If merged, however, this number may be dramatically reduced. It is often desirable to merge on a per-layer, per-cell basis prior to merging the flat representation, which is done automatically by the verification system for essentially every original layer. ");
MGCAddSnippet(42, "Magnification of the input layout database is dependent upon a number of factors including database and rule file precisions and magnifications specified in the rules.");
MGCAddSnippet(43, "The Layout Primary (and Layout Primary2) specification statement argument may contain one or more wildcard (*) characters. This allows the system to attempt a degree of auto-recognition of the top-level cell in an input layout database. ");
MGCAddSnippet(44, "Calibre tools can generate warnings that indicate a possible data integrity issue with the input database, such as when it excludes the objects that cause these warnings from processing. ");
MGCAddSnippet(45, "The Calibre layout data input module issues a warning for any non-extended path type such that either end segment length is less than 1/2 of the path width. The warning is issued because the expanded path may have a notched corner near the short end segment. The warning includes the path s layer, cell, and one of the end segment s coordinates. This applies to GDSII and OASIS. ");
MGCAddSnippet(46, "Calibre automatically reads properties from a GDSII or OASIS input layout database to support.");
MGCAddSnippet(47, "Calibre tools support a variety of geometric layout formats.");
MGCAddSnippet(48, "Calibre processes GDSII version 6.0. Later versions are not supported.");
MGCAddSnippet(49, "Calibre supports OASIS 1.0.");
MGCAddSnippet(50, "Calibre tools read LEF/DEF and OpenAccess layout formats.");
MGCAddSnippet(51, "When the layout database format is ASCII (specified as Layout System ASCII), it appears as a set of polygon files in the form icv_data_n, where n represents the corresponding drawn layer number. The file is assumed to be in the current directory. This format is used only by flat Calibre applications and ICverify.");
MGCAddSnippet(52, "This chapter describes fundamental concepts germane to Calibre nmDRC operation, rule file structures, and usage.");
MGCAddSnippet(53, "The inputs to Calibre nmDRC are a rule file and a layout database. The outputs are a run transcript and a DRC Results Database, with an optional DRC Summary Report. Certain layer operations generate their own specialized results databases, and these are also optional.");
MGCAddSnippet(54, "Calibre nmDRC and Calibre nmDRC-H have some typical command line invocations.");
MGCAddSnippet(55, "Specification statements control the overall behavior of a Calibre run. These statements control things like inputs, outputs, which rule checks are run, which regions of the layout are checked, and so forth. ");
MGCAddSnippet(56, "Rule check statements are used in many Calibre applications (as well as other Siemens EDA tools that use rule files, like ICverify). They are used in design rule checks (DRC), optical and process checks (OPC), mask data preparation (MDP), and electrical rule check (ERC) operations performed in LVS. Rule checks specify layer operations that send the resulting derived layers into the results database.");
MGCAddSnippet(57, "You can use three types of comments within a rule file. The first is the standard comment denoted with a double-slash (//). The second is a rule check comment denoted with an  at  symbol (@). The third is a comment that spans multiple lines and is enclosed by a /* … */ sequence of characters.");
MGCAddSnippet(58, "Each rule check in the DRC results database stores information in addition to the actual results. This information includes the time and date of its previous execution and can also consist of text mapped by DRC applications. This text is known as check text. ");
MGCAddSnippet(59, "You can select one or more rule check statements from a rule file, which DRC runs as a unit. This unit is called the check set. A rule check name is specified immediately before an open brace in a rule check.");
MGCAddSnippet(60, "Calibre nmDRC and related applications only read in layers from the layout database as needed for the check set that is active for the run. If a layer is not required for the run, it is not read in. Similarly, layers are only derived as necessary to satisfy the data requirements of the check set.");
MGCAddSnippet(61, "You can limit the number of DRC results written to the DRC results database for any given rule check by using the DRC Maximum Results specification statement, or by using the MAXIMUM RESULTS parameter of the DRC Check Map specification statement. ");
MGCAddSnippet(62, "It is typical that rule checks may not generate any DRC results (empty rule checks). You may not want these rule checks to take up space in the DRC results database. In some cases, it is the execution of the rule check that is important, whether or not there actually are results.");
MGCAddSnippet(63, "Calibre nmDRC performs many of the layer operations concurrently. This means that they run simultaneously when present in a rule file. Whenever Calibre nmDRC performs layer operations, it locates all required layer operations within the set that it can run concurrently and executes them as a single group. This offers significant performance advantages.");
MGCAddSnippet(64, "Calibre nmDRC combines all identical layer operations during run time. Operations are identical if they have the same keyword, arguments, and input data. ");
MGCAddSnippet(65, "Calibre nmDRC applications automatically schedule all layer operations necessary to satisfy any data requirements of a layer operation.");
MGCAddSnippet(66, "Calibre nmDRC applications produce derived layer data during the course of operation and delete all original and derived data when they are no longer required. Some systems produce all derived layer data up front and delete all of the data when the run is complete. Calibre nmDRC attempts to maximize capacity by delaying data production until it is required and by deleting data when it is no longer required.");
MGCAddSnippet(67, "Calibre nmDRC performance depends on the amount of data Calibre nmDRC must use at any given time. In designing certain conjunctive checks, you can reduce data generation overhead and run time.");
MGCAddSnippet(68, "In general, it is best to avoid using a dimensional check operation when other operations would suffice. Dimensional check operations are slower than other layer operations because of the computational overhead of checking distances between numerous edges.");
MGCAddSnippet(69, "By default, Calibre nmDRC segments any DRC-generated polygon whose vertex count exceeds 4096. You can control the maximum vertex count for polygon segmentation with the DRC Maximum Vertex specification statement.");
MGCAddSnippet(70, "You must specify a rule file name to invoke Calibre nmDRC applications. Calibre nmDRC automatically compiles the rule file as the first step of executing the command. Compilation errors stop the program and error codes are issued to the run transcript along with descriptions of the error. ");
MGCAddSnippet(71, "Calibre nmDRC applications exit with a non-zero status if they cannot complete any form of requested processing due to fatal error conditions. In a Linux shell, you can check this status by examining the $? shell variable. ");
MGCAddSnippet(72, "Historically, physical verification has relied on independent, single-dimensional rule checks to identify layout features most sensitive to failure during manufacturing. As technology nodes shrink and manufacturing variability increases, checks must be written to address a new variety of complex design features.");
MGCAddSnippet(73, "To demonstrate the advantages of eqDRC, consider the example of wide metal spacing. Wide metal spacing refers to a design challenge where wide metal bands separated by small areas of silicon dioxide can lead to performance and yield problems. Since copper is softer than oxide, it is removed more easily during the Chemical Mechanical Polishing (CMP) process, which can lead to metal erosion.");
MGCAddSnippet(74, "You can implement rule checks that take advantage of eqDRC using a set of SVRF statements.");
MGCAddSnippet(75, "DFM Property is the keystone of eqDRC. It is a layer operation that accepts one or more layers. In most cases the input layers can be a combination of any layer type: original, derived polygon, derived edge, and derived error. It outputs a layer of the same type as the primary (first) input layer with any user-specified properties (name/value pairs) attached.");
MGCAddSnippet(76, "The DFM Function statement allows you to create a custom mathematical expression or lookup table for use in DFM Property statements.");
MGCAddSnippet(77, "DFM RDB is a layer operation that writes original or derived layer data to ASCII RDB format, including any attached properties. The DFM RDB operation must be contained inside a rule check. In a calibre -dfm run, the output RDB is stored in the DFM database and is not stand-alone as it is in a calibre -drc run.");
MGCAddSnippet(78, "DFM Copy is more flexible than the Copy operation in its handling of input layers. DFM OR performs an OR operation on the input polygon layers and includes DFM properties from the input layers on the output layer. ");
MGCAddSnippet(79, "Calibre nmDRC-H exploits the hierarchy in a design to reduce processing time, memory use, and DRC result counts when compared to flat DRC applications.");
MGCAddSnippet(80, "Calibre nmDRC-H maintains data (original or derived layer geometry) at the lowest possible hierarchical level. For original layer shapes, this means that Calibre stores the data once with the cell, just as in the original user design. ");
MGCAddSnippet(81, "Calibre nmDRC presents flat and hierarchical results differently in the DRC Summary Report and results databases. Hierarchical presentation offers a variety of settings to assist in result interpretation.");
MGCAddSnippet(82, "Calibre nmDRC-H has multithreaded modes of operation that greatly reduce runtimes. Multithreaded (MT) mode uses multiple CPUs on the same host and is enabled through the ‑turbo command line option. MTflex mode uses multiple CPUs on a network of hosts and is enabled with the -remote or -remotefile command line options. These modes apply to other Calibre tools as well.");
MGCAddSnippet(83, "Layer operations differ in their performance. There are some behaviors to be aware of when choosing various layer operations and options.");
MGCAddSnippet(84, "Calibre nmDRC-H supports layers in both hierarchical and flattened form.");
MGCAddSnippet(85, "In certain uncommon situations, the results from Path Length operations in hierarchical runs can differ from flat runs. Such cases involve a singularity point where polygon corners meet. ");
MGCAddSnippet(86, "When first generating the layer, flat applications print the total area of a polygon-type layer in the transcript with other related statistics. Hierarchical applications do not do this by default because of the time it requires. However, you can specifically request this information with the DRC Print Area specification statement.");
MGCAddSnippet(87, "You can use the DRC Map Text specification statement to cause Calibre nmDRC-H to transfer all text objects in the input layout database to a mask data results database. The text objects have the same hierarchy in both the input and results databases, unless DRC-H expands or flattens a placement during hierarchical processing. In that case, DRC-H moves the text up the hierarchy, as appropriate.");
MGCAddSnippet(88, "The Hcell statement is used by Calibre nmLVS-H to denote the correspondence between cells in the layout and cells in the source. In circuit extraction, hcells in the layout are preserved. A similar effect occurs in hierarchical DRC runs.");
MGCAddSnippet(89, "Dimensional check operations represent the core design rule checking capability of Calibre nmDRC. The dimensional check operations generate derived error layers, derived edge layers, or derived polygon layers by measuring the separation of edges on one or two input layers.");
MGCAddSnippet(90, "There are three primary dimensional check operations: ENClosure, EXTernal, and INTernal.");
MGCAddSnippet(91, "The dimensional check operations, as well as many other statements in the SVRF language, have optional secondary keywords associated with them. These secondary keywords affect the behavior of the operator to which they are assigned. ");
MGCAddSnippet(92, "The dimensional check operations measure the separation between the insides and outsides of edges only if the edges conform to the criteria of the operation. ");
MGCAddSnippet(93, "To construct the region about an edge, a boundary forms on either the outside or inside of the edge, as specified by the operation. This area is referred to as a half-plane. The shape of this boundary is determined, in part, by the numeric value within the operation s constraint. The boundary consists of all points in the half-plane whose distance from the edge is the numeric value of the constraint. ");
MGCAddSnippet(94, "There are four standard forms of metrics used with dimensional check operations: Euclidean, Square, Opposite, and Opposite Extended value.");
MGCAddSnippet(95, "The main purpose of the Opposite metric is to reduce the number of non-orthogonal (with respect to the database axes) edges created when using polygon-directed output (REGION keyword).");
MGCAddSnippet(96, "Certain specialized metrics are used mostly for OPC applications and mask data preparation. They are not generally used for typical DRC checks, but can occasionally be useful in such applications.");
MGCAddSnippet(97, "The set of Opposite Symmetric metrics use the Opposite metric for measurement, along with post-processing of the output to achieve better symmetry for non-parallel edges. ");
MGCAddSnippet(98, "The set of unidirectional metrics use the Opposite Symmetric measurement but measure in one direction only, and then projecting any positive output in the other direction. These metrics assume two input layers.");
MGCAddSnippet(99, "The Square Orthogonal metric for dimensional check operations EXTernal, INTernal, and ENClosure simulates simultaneous mask misalignment in the x- and y-directions. ");
MGCAddSnippet(100, "The edge measurement methods described previously generate edge clusters in error-directed output (edge-directed or polygon-directed output does not have this feature). These are groups of edges or edge segments that are output by a rule check containing error-directed operations. Several different types of clusters can be formed. ");
MGCAddSnippet(101, "The edge measurement regions can create a trivial edge, which is an edge consisting of only one point. This is the result of measuring two edges when the constraint specifies that the boundary is to be included in the region (for example, <= a), and one of the edges intersects the region around the other edge at only a single point on the boundary. ");
MGCAddSnippet(102, "Trivial edge generation can lead to a four-edge output cluster, which primarily occurs when there are two output segments from edge A but none from edge B, or vice versa. In this case, Calibre nmDRC constructs two trivial output edges from B, each corresponding to a segment from A. The output itself is a four-edge cluster. ");
MGCAddSnippet(103, "There is special treatment of true point-to-point output from the measurement process for error-directed and polygon-directed dimensional checks. This output consists of two trivial edges (points), which are generated as a result of the actual measurement process. These are not generated due to measurement region intersections being non-commutative. ");
MGCAddSnippet(104, "In conjunctive design rule checking (rule checks where more than one error output operation appears), you may want to suppress redundant errors with interval constraints containing two numerics in the final dimensional check operation. ");
MGCAddSnippet(105, "The dimensional check operations consider two edges to be appropriate for measurement if the corresponding sides of the edges face each other.");
MGCAddSnippet(106, "When two edges A and B are measured by dimensional check operations, output from the measurement process can be suppressed to various extents due to the presence of shielding edges. A shielding edge is an edge S that completely or partially blocks the line-of-sight between edges A and B. ");
MGCAddSnippet(107, "By default, the dimensional check operations do not measure the separation between the corresponding sides of intersecting edges, even if they conform to the appropriateness criteria. However, this behavior can be altered by using appropriate secondary keywords such as ABUT and the INTERSECTING families of keywords. ");
MGCAddSnippet(108, "Edge breaking occurs during the evaluation of a two-layer dimensional check operation. Calibre breaks edges into edge segments from each input layer that crosses polygon boundaries of the other input layer. This edge-breaking method eliminates many false errors and makes the output from the two-layer dimensional check operations more precise.");
MGCAddSnippet(109, "Given that edge breaking occurs in the two-layer dimensional check operations, we can define these operations in a more rigorous manner through the use of polygon containment criteria.");
MGCAddSnippet(110, "The dimensional check operations function in three primary output modes: error-directed, edge-directed, and polygon-directed.");
MGCAddSnippet(111, "There may be times when you need to have error-directed measurement operations result in edge-directed output. The section provides examples of how to create derived edge layers from error-directed measurement operations.");
MGCAddSnippet(112, "Polygon-directed dimensional check operations generate derived polygon layers by forming the polygon projections between edges in edge-clusters which would have been present in the corresponding error-directed dimensional check operation. ");
MGCAddSnippet(113, "When deriving layers using the REGION keyword and the Euclidean (default) measurement metric, large numbers of skew edges can be generated. Although Calibre has internal optimizations to handle such layers, it is better to avoid producing such layers due to the performance impact of managing them. This is most commonly done with the OPPOSITE REGION keyword set, which causes the output polygons to have edges that are orthogonal to the database axes.");
MGCAddSnippet(114, "There are cases where output from DRC measurements is undesirable, or false, due to the lack of endpoint blocking edges at the appropriate level of the hierarchy between two measured edges.");
MGCAddSnippet(115, "Tolerances for dimensional check operations are controlled globally using the DRC Tolerance Factor specification statement. Tolerances can also be built into measurement constraints of individual layer operations.");
MGCAddSnippet(116, "Calibre nmDRC has a number of features that are tailored to specialized requirements.");
MGCAddSnippet(117, "The DRC Check Map specification statement provides a way to output layers to mask data DRC results databases. Among its many configuration options, it allows an m -> n mapping between DRC rule check outputs and DRC results databases, as well as AREF compaction capability for rectangles. It also allows per-rule-check specification of the maximum result count. ");
MGCAddSnippet(118, "The DRC Check Map specification statement allows per-rule-check specification of a DRC results database and its associated type (ASCII, GDSII, or OASIS), as well as the hierarchy form, and any cell prefixes or suffixes. These attributes are globally-specified in the DRC Results Database specification statement. ");
MGCAddSnippet(119, "Given the set of unique DRC rule checks {R1, …, Rn} to be executed in a DRC run, a set of unique DRC result databases {D1, …, Dm} is determined which encompasses the cumulative DRC output from the application. Each results database Dj has an associated (and unique) type (ASCII, GDSII, or OASIS). The mapping is n->m. Any given DRC rule check Ri may map to multiple members of {D1, …, Dm} and any given DRC results database Dj may be mapped into by multiple members of {R1, …, Rn}.");
MGCAddSnippet(120, "In hierarchical Calibre applications, AREF structures are specified from arrayed rectangles in a GDSII-type DRC results database. AREF output is specified by the optional AREF parameters in the DRC Check Map specification statement and is discussed in detail in the SVRF Manual. AREF structures form orthogonal arrays. By default, 16 objects are placed into an AREF structure because this offers a good balance between compacting the database and performance.");
MGCAddSnippet(121, "Fill cells for AREF structures can be implemented in one of two ways. ");
MGCAddSnippet(122, "Another option for outputting more compact GDSII mask results databases is to use the AUTOREF keyword for DRC Check Map. This option is highly efficient in compacting results that have large arrays of rectangles, such as from fill operations. This option is easier to use than the AREF option, but offers less customizable control.");
MGCAddSnippet(123, "Original geometry flagging causes warnings to be generated when original shapes which fail certain constraints are read from the layout database (the original shapes are still processed, however).");
MGCAddSnippet(124, "Original geometry snapping aligns vertices of original shapes on specified grids. If Snap Offgrid YES is specified in the rule file, then original layer shapes read by Calibre are snapped to the grid specified in the Resolution specification statement or, if present, the grid specified in the Layer Resolution specification statement for the given original layer. Snapping occurs prior to any acute, skew, or off-grid flagging. Snapping preserves 45-degree angles on edges between two orthogonal edges if the snap resolution has equal x- and y-values.");
MGCAddSnippet(125, "Calibre DRC applications can check for soft connections with the External operation. Calibre nmLVS checks for soft connections with the LVS Softchk specification statement, which you cannot use with DRC applications. The INSIDE ALSO and NOT CONNECTED secondary keywords of the External operation are useful in soft connection DRC checks. ");
MGCAddSnippet(126, "By default, geometric data on layers (original and derived) created during a DRC run is memory-based. The majority of memory used during execution is consumed by geometric data. You may specify that geometric data on layers created during a DRC run is to be primarily disk-based rather than memory-based. In most cases, this can save substantial amounts of memory by transferring this resource to disk file(s).");
MGCAddSnippet(127, "DRC applications output a transcript, a results database, and a summary report (if specified). The run transcript has features that are common to all batch Calibre tools that read geometric databases. ");
MGCAddSnippet(128, "Calibre applications produce a transcript showing statistics for the different runtime modules.");
MGCAddSnippet(129, "The transcript header provides information about the Calibre version, the host, Calibre executable, and the job.");
MGCAddSnippet(130, "The  STANDARD VERIFICATION RULE FILE COMPILATION MODULE  section of the transcript includes information about the rule file and the status of the Calibre environment. ");
MGCAddSnippet(131, "The  CALIBRE LAYOUT DATA INPUT MODULE  section of the transcript includes information about the layout system, magnification, and layout statistics. The discussion in this section assumes hierarchical run data.");
MGCAddSnippet(132, "In the transcript, Calibre applications print all connectivity extraction text objects in the run.");
MGCAddSnippet(133, "Both the transcript and the summary report file (if specified) provide many statistics independent of the derived layer statistics. In hierarchical applications, these statistics appear as a pair of numbers, with the second number in parentheses. The first number is the hierarchical count and the second is the (estimated) flat count. ");
MGCAddSnippet(134, "The Results Database Initialization section of the transcript shows the rule file settings for results database settings for Calibre nmDRC applications. ");
MGCAddSnippet(135, "The section entitled  CALIBRE::<tool> EXECUTIVE MODULE  reports layer derivations, rule check execution, connectivity extraction, tool-specific processes, operating parameters, various event logs, warning messages, and summary information. The <tool> varies depending on command line options used for the run.");
MGCAddSnippet(136, "Time stamps appear throughout the transcript. Some of the time stamps are for individual modules, some are for the generation of layers, and some are for other purposes. Time of generation for layers may differ across various executive modules.");
MGCAddSnippet(137, "Certain transcript statistics are relevant to flat processing of layers.");
MGCAddSnippet(138, "Certain statistics in the run transcript are relevant to hierarchical processing of layers.");
MGCAddSnippet(139, "The LVHEAP numbers, which appear with all derived layer and results layer statistics in the transcript, report approximate current memory usage for Calibre applications. These applications run completely in memory when layers are memory-based.");
MGCAddSnippet(140, "The end of a DRC transcript shows data based upon layer operation categories. This shows performance information that can be useful in rule file optimization.");
MGCAddSnippet(141, "Calibre multithreaded run modes have specific transcript features. Some of these features are common among the various modes, while others differ.");
MGCAddSnippet(142, "Most of the features in this section are present in MT and MTflex transcripts with hyperscaling enabled. When this is not the case, MT mode is specifically used. ");
MGCAddSnippet(143, "The Calibre MTflex transcript with hyperscaling enabled is similar to the transcript produced in MT mode with hyperscaling, but the MTflex transcript has some unique features.");
MGCAddSnippet(144, "If you use MT mode without hyperscaling, then the features of the transcript have some minor differences from a single-processor run, as well as from a hyperscaling run. ");
MGCAddSnippet(145, "If you use MTflex mode without hyperscaling, then the features of the transcript differ somewhat from a hyperscaling transcript. ");
MGCAddSnippet(146, "A DRC results database is created for each DRC run. This file can be an ASCII, GDSII, or OASIS results database. ASCII is the most common DRC results database format. ");
MGCAddSnippet(147, "Calibre nmDRC generates an ASCII DRC results database by default. This format is used by Calibre RVE and ICrules for viewing geometric results.");
MGCAddSnippet(148, "Some layer operations can produce an ASCII results database that is ancillary to the global DRC results database generated by the DRC Results Database statement. These ancillary results databases are called RDBs (results databases), which is taken from the RDB keyword option. These RDBs are generally the same format as the global DRC results database, but they have calculated properties that do not appear in the global DRC results database.");
MGCAddSnippet(149, "The first line in the results database shows the top-cell name. The top-level cell name is given unless the Layout System is ASCII, in which case the string drc is given.");
MGCAddSnippet(150, "The first line for each rule check group contains the name of the rule check. Rule check statement names are assumed to be unique. The next line contains three numbers followed by a date and time stamp, separated by one or more spaces. ");
MGCAddSnippet(151, "After the rule check name, result counts, and date and time stamp, the default check text shown includes the pathname of the rule file, title of the rule file (if any), and any rule check comments. You can remove this information or you can add more information with the DRC Check Text specification statement.");
MGCAddSnippet(152, "The filenames for all RDBs created by certain operations like Density, Net Area Ratio, and DRC Check Map are listed (as separate DRC rule checks) at the end of the global DRC results database if it is ASCII type. The intent is for these filenames to be shown as an  error  in Calibre RVE and similar applications so that you do not inadvertently fail to notice their existence after an DRC run. ");
MGCAddSnippet(153, "The filenames for all PRINT files created by Density PRINT and Net Area Ratio Print are listed (as separate DRC rule checks) at the end of the global DRC results database if it is ASCII type. The intent is for these filenames to be shown as an  error  in Calibre RVE and similar applications so that you do not inadvertently fail to notice their existence after a DRC run. ");
MGCAddSnippet(154, "Following the header information is a list of DRC results. Each DRC result listing begins on a new line. The DRC results can be one of two types: a polygon or an edge cluster. These are distinguished by the respective signatures  p  and  e . These signatures begin the listing for each DRC result. ");
MGCAddSnippet(155, "If you use the YES option in DRC Cell Name or ERC Cell Name specification statements, the results database contains additional cell name information. The beginning CN characters stand for  Cell Name.  The CELL SPACE and XFORM keywords cause additional information to be printed in the results database. This property is described in detail in the SVRF Manual under each specification statement s section.");
MGCAddSnippet(156, "ASCII DRC results databases, including those generated with the RDB keyword, allow properties to be attached to individual results. An ASCII DRC results database property is a string ( ID ) followed by context-dependent information (which may be empty). ");
MGCAddSnippet(157, "Calibre nmDRC generates a GDSII DRC results database if the GDSII keyword is specified in the DRC Results Database or DRC Check Map specification statement.");
MGCAddSnippet(158, "Calibre nmDRC generates an OASIS DRC results database if the OASIS keyword is specified in the required DRC Results Database or DRC Check Map statement. This format is not readable by the ICrules RESTORE DRC RESULTS command. ");
MGCAddSnippet(159, "Calibre nmDRC allows you to specify an upper bound on the number of DRC results per rule check written to the results database. This limits the number of DRC results added per rule check, not the total number of results generated in the entire run. If you specify an upper bound value, whenever DRC generates results equal to the upper bound for any single rule check, it adds no further results into the DRC results database for that rule check and issues a warning message. ");
MGCAddSnippet(160, "A hierarchical DRC results database is produced by Calibre nmDRC-H. For GDS and OASIS output, the Calibre representation of the database hierarchy is preserved, and there is no suppression or top-level transformation of DRC results (as is found with ASCII type DRC results databases). Cell names are output with an optional string appended; this optional string is determined by the DRC Results Database specification statement. ");
MGCAddSnippet(161, "The DRC Summary Report specification statement in the rule file writes a summary of a DRC run. This report consists of heading information, runtime warnings, original layer statistics, rule check results statistics, and other information that encapsulates the run. The HIER option is recommended for hierarchical runs.");
MGCAddSnippet(162, "Connectivity extraction recognizes electrically-connected regions in the layout called nets. Nets are recognized from layout shapes through analysis of the relations between the shapes and other objects on various layers such as text objects.");
MGCAddSnippet(163, "Mask connectivity extraction analyzes layout hierarchy and extracts connectivity from mask-level shapes. It is only invoked as an internal subsystem by other components of the layout verification system, such as DRC and LVS.");
MGCAddSnippet(164, "Rule file compilation verifies that any operation requiring connectivity has the requisite nodal information on the appropriate input layer(s). ");
MGCAddSnippet(165, "A number of rule file statements cause connectivity to be established on layers. The shapes that have the same connectivity are recognized as being on the same electrical net.");
MGCAddSnippet(166, "Text objects that are present in the layout database or that are created in the rule file are processed for a number of purposes.");
MGCAddSnippet(167, "Net names can be specified in the rule file, be written in the layout database as text objects, or both. ");
MGCAddSnippet(168, "Layout verification applications that use connectivity extraction merge original database layers internally before using them for any other operations. ");
MGCAddSnippet(169, "The connectivity extractor generates internal label objects to represent text data from various sources: rule file Layout Text, Layout Text File, and Text specification statements, and geometric text objects. Each label is represented by a location, a layer, and a name. A location can be a simple (x,y) point, or it can be the whole area of a database shape or path. ");
MGCAddSnippet(170, "In Calibre applications, open and short circuits are reported for text labels that cause such discrepancies.");
MGCAddSnippet(171, "Antenna checks are a broad category of design checks intended for finding interconnect paths of sufficient surface area such that they can accumulate excessive charge during the fabrication process. These paths are called antennas and can adversely affect chip yield. ");
MGCAddSnippet(172, "By default, virtual connection in Calibre nmDRC-H with DRC Incremental Connect YES is only performed within the last Connect block or within a Connect block where there is a [Not] Net operation between the current Connect block and the subsequent one. ");
MGCAddSnippet(173, "When using incremental connectivity, there are a number of rule file organization practices that offer better runtime performance.");
MGCAddSnippet(174, "There are cases where it is desirable to suppress connectivity extraction warnings in incremental connectivity flows. An example could be an antenna check flow where any warnings could be considered false. Also, for certain reasons, warnings in intermediate connectivity zones due to [Not] Net operations may also be considered undesirable. ");
MGCAddSnippet(175, "The Disconnect operation allows total deletion of the existing connectivity model in an incremental connect sequence. That is, the presence of a Disconnect operation causes the current connectivity build-up to be discontinued. The next Connect operation begins the new connectivity build-up.");
MGCAddSnippet(176, "Warnings from connectivity extraction in Calibre nmDRC appear in the run transcript and in the DRC Summary Report, if specified. ");
MGCAddSnippet(177, "Circuit extraction is part of the LVS flow. Circuit extraction occurs before LVS comparison and includes various modules such as connectivity extraction, short isolation, device recognition, netlist writing, ERC checking, and soft connection checking.");
MGCAddSnippet(178, "Hyperscaling is enabled in Calibre nmLVS-H connectivity extraction through the -hyper command line option. The -hyper option can only be specified with the -turbo option. A minimum of four CPUs is recommended on the local host machine when running with ‑hyper.");
MGCAddSnippet(179, "Hierarchical circuit extraction (as with the -spice option) does not require an hcell list. Extraction is performed hierarchically, based on the original database hierarchy. Some cells may be expanded or flattened based upon internal heuristics that determine when it is more efficient to do so.");
MGCAddSnippet(180, "The Layout Preserve Cell List statement allows you to protect certain layout cells from most hierarchy modifications, including automatic expansion, during connectivity extraction. Such preserved cells are treated as if they were hcells during connectivity extraction but are not used as hcells during LVS comparison. ");
MGCAddSnippet(181, "Netlists extracted from the layout have a SPICE-like format. ");
MGCAddSnippet(182, "When the hierarchical circuit extractor is used, unexpanded layout cells are extracted as SPICE subcircuits. If an extracted subcircuit contains no devices anywhere in its hierarchy, it is not called in the extracted netlist.");
MGCAddSnippet(183, "If a net is named (texted) in the layout, then that name usually appears in the extracted SPICE netlist. However, if a net name is not valid for netlisting, then the internal net number appears instead. ");
MGCAddSnippet(184, "A port is an entry point to a cell and forms the external interface of the cell. A port becomes an instance pin (or simply, a pin) when the cell is placed in the layout hierarchy and the port makes a connection outside the cell. In LVS and Calibre xRC applications, text and polygon objects on port layers can be read and netlisted as ports.");
MGCAddSnippet(185, "Port objects are read from all levels of hierarchy and are used locally in the cells where they appear. ");
MGCAddSnippet(186, "Unattached ports occur in the layout when the port layer does not appear in Connect, Attach, or Label Order statements; or there is no geometry that the port can be attached to at the port location. ");
MGCAddSnippet(187, "In Calibre nmLVS-H, you can propagate power and ground net names throughout the hierarchy from lower-level ports by specifying LVS Cell Supply YES. ");
MGCAddSnippet(188, "A floating pin is unconnected to any other instance pin or to a pin of a parent subcircuit. If a subcircuit in the extracted netlist has a floating pin in all instances of this subcircuit, that is, the pin is never connected to any other instance or to a pin of the parent subcircuit, this pin can be omitted from the netlist.");
MGCAddSnippet(189, "The virtual connect technique in layout verification uses the layout connectivity extractor to form a single net from two or more disjoint nets by virtue of net segments that share the same name after processing. ");
MGCAddSnippet(190, "Connectivity extraction messages are issued to the run transcript and the circuit extraction report.");
MGCAddSnippet(191, "Conflicts in Sconnect connectivity are reported in the circuit extraction transcript and the circuit extraction report. In addition, SPICE comments are written into the extracted SPICE netlist in subcircuits where Sconnect conflicts occur.");
MGCAddSnippet(192, "When running LVS Softchk, sometimes the number of results can be overwhelming to debug. In order to fix soft connection problems efficiently, it is best to focus on fixing the central problem, and then divide the remaining problems up into more manageable pieces. While the material in this section is written from the standpoint of LVS Softchk, it also applies to Calibre nmLVS Reconnaissance Softchk (calibre -recon -softchk), qs::softchk, and qs::softchks results, with appropriate accommodation of the syntax elements that map to each other in the various usages.");
MGCAddSnippet(193, "This file is output when soft connection checking is requested.");
MGCAddSnippet(194, "Soft connections can be determined by contact count as opposed to vertex count.");
MGCAddSnippet(195, "Used for soft-connection reporting based upon shared contact counts.");
MGCAddSnippet(196, "A text short occurs when a layout net has two different connectivity text objects associated with it. Such shorts can lead to problems with net name assignment, which impacts things like ERC checks and LVS comparison results. Short isolation is the process of identifying and fixing text short discrepancies. Text shorts are always reported in the run transcript when circuit extraction is performed. They also appear in a circuit extraction report when one is produced. Most importantly, Calibre offers three flows for finding shorts. The first is implemented through the LVS Isolate Shorts specification statement. The second is implemented through the Mask SVDB Directory SI option, and the third is implemented through the -recon -si command line options. The latter two methods support interactive short isolation in the Calibre Query Server Tcl shell. All flows support Calibre RVE short debugging.");
MGCAddSnippet(197, "Device recognition extracts instances of devices from collections of shapes in the layout, computes specified properties of these instances, and prepares the results for use by other processes. ");
MGCAddSnippet(198, "DEVice statements govern how devices are recognized and classified, and how properties are computed.");
MGCAddSnippet(199, "Device recognition attempts to match device instances in the layout based upon DEVice statements you provide in your rule file. DEVice statements are patterns, or templates, which the device recognition algorithms use to classify device instances and compute their properties. ");
MGCAddSnippet(200, "Device instance recognition identifies sets of interacting device seed and pin shapes that match the specifications in a DEVice statement. ");
MGCAddSnippet(201, "Device recognition analyzes each layer that appears as a device layer in one or more statements. At the same time that the device layer is examined, a set of auxiliary and pin layers is examined. This set consists of all the auxiliary and pin layers from all DEVice statements containing the given device layer. Different statements sharing the same device layer compete for classification of each seed shape on that layer. ");
MGCAddSnippet(202, "During the scan of device layers, device recognition forms initial pins when a device shape touches one or more shapes on a pin layer. ");
MGCAddSnippet(203, "The fill-in algorithm tries to find a unique match to a DEVice statement by duplicating existing pins to fill in for missing pins. More precisely, a provisional match is made between the initial pin set and any DEVice definition for which certain conditions are true.");
MGCAddSnippet(204, "When device recognition classifies a shape on a device layer as ill-formed, they are identified as discrepancies.");
MGCAddSnippet(205, "Device signatures are managed by the DEVice statement s SIGNATURE keyword. A signature is a set of polygons that is in proximity to a device seed shape and is used to identify the device type of a layout instance.");
MGCAddSnippet(206, "The DFM Property operation is used in Advanced Device Properties (ADP) applications. This operation requires care in handling undefined mathematical expressions, such as division by zero.");
MGCAddSnippet(207, "Bad (or ill-formed) devices are reported in the circuit extraction report file and the run transcript. ");
MGCAddSnippet(208, "The DEVice operation includes two secondary keywords that apply to hierarchical applications: BY NET and BY SHAPE. These have effects on how devices are recognized in a hierarchical run. Seed promotion occurs in certain cases when a device instance cannot be recognized at the original hierarchical level that a seed shape appears. It is important to understand the causes for this when it occurs.");
MGCAddSnippet(209, "Calibre nmLVS uses computed property values when comparing the layout netlist to the schematic netlist. After LVS recognizes a device instance, it computes the property values for the device instance. The property specification and the element name determine the properties to be computed.");
MGCAddSnippet(210, "Default property computations are available for devices with reserved element names.");
MGCAddSnippet(211, "The DEVice statement allows you to define your own property computation algorithm for any device. For any device, including built-in devices, if you choose to compute properties using your own algorithm, you assume responsibility for calculating all properties for that device, including any properties that would have been computed by default.");
MGCAddSnippet(212, "If you calculate A and P properties for capacitors (C element), by default, capacitor instances have comment-coded properties $A and $P written for them in the extracted layout netlist. These correspond to area and perimeter.");
MGCAddSnippet(213, "You should consider the selection of appropriate units when computing numeric properties that represent physical quantities.");
MGCAddSnippet(214, "At the time a rule file is loaded, each DEVice statement containing a property computation causes the generation of a value array. The value array is an array of properties indexed from zero through a maximum number. ");
MGCAddSnippet(215, "Because you can generate property computations for each of a large number of device instances, it is important to consider efficiency when writing property specifications using the built-in language. ");
MGCAddSnippet(216, "By using the DEBUG command in a property computation program, you can obtain a detailed analysis of the property computation for any device instances you choose.");
MGCAddSnippet(217, "The DEVice property computation language employs a DEBUG statement to facilitate debugging of property computation programs. In the following code, a DEVice statement appears on lines 23-37 of the rule file. The line numbers are not part of the DEVice statement itself but are used in debugging output to identify which line of the program is responsible for each step in the analysis.");
MGCAddSnippet(218, "In a hierarchical run, device instances are generated on a per-cell basis. This makes finding the exact instance number to debug more challenging. It s often better to run small layout test cases flat when debugging property computations because finding the instances to debug is easier.");
MGCAddSnippet(219, "You can use the $D property to determine which DEVice statement in the rules is responsible for classifying the device.");
MGCAddSnippet(220, "DEBUG statement output appears as comments in the run transcript. ");
MGCAddSnippet(221, "Electrical rule check (ERC) operations in Calibre perform geometric checks based upon connectivity. ERC checking can be accomplished in two ways: in an LVS circuit extraction run or using Calibre nmLVS Reconnaissance ERC.");
MGCAddSnippet(222, "ERC has its own set of specification statements and operations.");
MGCAddSnippet(223, "ERC is controlled by the ERC Select Check and LVS Execute ERC specification statements.");
MGCAddSnippet(224, "When ERC is used in flat LVS, flat DRC and flat LVS licenses are used. When used in hierarchical circuit extraction (calibre ‑spice), four licenses are used: Calibre nmLVS, Calibre nmLVS-H, Calibre nmDRC, and Calibre nmDRC‑H. ");
MGCAddSnippet(225, "LVS uses a three-step process to enable rule checks.");
MGCAddSnippet(226, "You can abort a Calibre nmLVS run due to ERC errors by specifying the ABORT LVS option in an ERC Select Check statement.");
MGCAddSnippet(227, "Text case of nets is not considered by ERC path checking by default. However, this can be changed.");
MGCAddSnippet(228, "User-defined devices are not considered in ERC path checking by default. However, this behavior can be changed.");
MGCAddSnippet(229, "The ERC Results Database statement generates a results database similar to the ASCII type generated during a DRC run. This database can be loaded into Calibre RVE for cross-probing into your layout, just as with a DRC Results Database.");
MGCAddSnippet(230, "ERC operations contain secondary keywords that instruct Calibre to produce auxiliary files. These are in addition to, or instead of, results sent to the ERC results database.");
MGCAddSnippet(231, "When the ERC Summary Report statement is specified, a report file is generated similar in most respects to the DRC Summary Report.");
MGCAddSnippet(232, "Trivial pin removal occurs as a part of circuit extraction and can affect ERC path checking.");
MGCAddSnippet(233, "The following examples show how you can use the Pathchk operation to create a layer or generate an auxiliary file. You can also do both of these actions during a single run.");
MGCAddSnippet(234, "ERC-specific operations executed in a DRC run produce empty result layers and a warning is generated. PRINT options are not executed. ERC Select Check statements have no effect in a DRC run.");
MGCAddSnippet(235, "LVS compares a layout design s topology to a source netlist. This comparison checks that the functional intent of the source schematic is represented in the layout. Calibre nmLVS and Calibre nmLVS‑H use SPICE netlists for the comparison. Discrepancies are listed in a text report. A results database called a Mask SVDB Directory may be used together with Calibre RVE and a layout viewer for graphical debugging.");
MGCAddSnippet(236, "The inputs to Calibre nmLVS are a rule file, a layout netlist or geometric database, and a source netlist. In LVS-H, an hcell correspondence list is also used and can be specified in its own file, in the rule file, or generated automatically when cell names match between layout and source. ");
MGCAddSnippet(237, "LVS applications compare electrical circuits from the specified source netlist and the layout. When the compared circuits are equivalent, LVS establishes a one-to-one correspondence between elements of one circuit (instances, nets, ports, and instance pins) in the source netlist and elements of the layout circuit. ");
MGCAddSnippet(238, "Calibre nmLVS uses certain matching pairs of nets, pairs of instances, and pairs of ports, which have identical user-given names in both the source and layout circuits as initial correspondence points (also called anchor points). Initial correspondence points assist in matching layout and source design topologies and make that process more efficient.");
MGCAddSnippet(239, "An LVS component type is a name that uniquely identifies the electrical or logical function of a layout or source instance. Calibre nmLVS uses component type values in the process of matching layout and source instances. Instances are required to have the same component type in order to be correctly matched. Instances with different component types are sometimes matched if they are identically connected, but discrepancies are reported in such cases.");
MGCAddSnippet(240, "LVS uses a number of naming conventions that appear in the LVS Report, run transcript, and Mask SVDB Directory results. It is helpful to be familiar with these conventions when debugging results.");
MGCAddSnippet(241, "Calibre nmLVS uses instance pin names to match circuit elements in the connectivity comparison process. Pins and pin names are normally inherited by instances from rule file operations and SPICE netlist elements.");
MGCAddSnippet(242, "Net and instance names are specified in geometric layout and SPICE netlists. They are obtained differently in the two design types.");
MGCAddSnippet(243, "Design ports and port names are specified in geometric layout and SPICE netlists.");
MGCAddSnippet(244, "Calibre nmLVS uses power and ground nets in logic gate recognition, in filtering of unused MOS transistors, and in other applications. Several power nets and several ground nets are allowed in a single design. ");
MGCAddSnippet(245, "The nets, instances, and ports of layout and source databases can have user-given names, system-generated names, or both. Calibre nmLVS reports differences between user‑given names of layout and source elements. ");
MGCAddSnippet(246, "Layout and source names are handled in a case-insensitive manner by default. Various aspects of case-sensitive name handling can be controlled from the rule file.");
MGCAddSnippet(247, "Certain SPICE device component types are recognized as built-in to the LVS system. These component types receive special processing that other components do not.");
MGCAddSnippet(248, "Calibre nmLVS performs the following for built-in capacitors: series capacitor reduction, parallel capacitor reduction, pin swapping if requested, processing of soft substrate pins, and pin names are always case-insensitive. ");
MGCAddSnippet(249, "Calibre nmLVS performs the following for diodes: parallel diode reduction, processing of soft substrate pins, and pin names are always case-insensitive. ");
MGCAddSnippet(250, "MOS regular transistors recognized as built-in devices receive special default processing by Calibre nmLVS as follows: logic gate recognition, logic injection, parallel transistor reduction, split-gate reduction, shorting of equivalent nodes in split gates, filtering of unused transistors, source/drain pin swapping, processing of soft substrate pins, and pin names are always treated as case-insensitive. Series MOS reduction and processing of soft substrate pins can also be enabled. ");
MGCAddSnippet(251, "Calibre nmLVS performs the following for resistors: series resistor reduction, parallel resistor reduction, pin swapping by default, processing of soft substrate pins, and pin names are always case-insensitive. ");
MGCAddSnippet(252, "Calibre nmLVS performs the following for bipolar devices: parallel bipolar transistor reduction, filtering of unused bipolar transistors, processing of soft substrate pins, and pin names are always case-insensitive. ");
MGCAddSnippet(253, "JFET transistor devices (component type J) must have at least three pins— gate, source, and drain. In addition, they may have any number of additional pins with arbitrary names. The optional pins may represent one or more substrate connections or they may be used for any other purpose.");
MGCAddSnippet(254, "Inductor devices (component type L) must have at least two pins— positive and negative. In addition, they may have any number of additional pins with arbitrary names. The optional pins may represent one or more substrate connections or they may be used for any other purpose.");
MGCAddSnippet(255, "Voltage source devices (component type V) must have at least two pins—positive and negative. In addition, they may have any number of additional pins with arbitrary names. The optional pins may represent one or more substrate connections or they may be used for any other purpose.");
MGCAddSnippet(256, "X+ devices are MOS transistors having a subtype beginning with the letter X and at least one more character.");
MGCAddSnippet(257, "MS and MF are special device types supported by LVS. They are 3-pin schematic symbols that represent 4-pin CMOS transistors. The fourth bulk pin is implied by the device type. MS devices have their bulk pin implicitly connected to the source, MF devices have their bulk pin floating.");
MGCAddSnippet(258, "Calibre nmLVS iterates between two methods of matching elements: signature-based hashing and tracing.");
MGCAddSnippet(259, "Calibre nmLVS classifies elements of both compared circuits (nets, instances, and ports) into one of three categories.");
MGCAddSnippet(260, "Ambiguities occur in highly parallel and symmetric circuits. These are circuits where parts can be interchanged without affecting the connectivity. In these cases, it is impossible to distinguish between the interchangeable parts.");
MGCAddSnippet(261, "Calibre nmLVS internally reduces groups of devices in the layout and in the source. Each group is represented by a single, virtual device. After reduction, the circuits are compared in terms of the virtual devices. Device reduction handles situations where, for example, a single schematic device is implemented by a group of several parallel or series devices in the layout.");
MGCAddSnippet(262, "When reducing devices, Calibre nmLVS reduces series structures first, then parallel, then series, then parallel, and so forth until all devices are reduced.");
MGCAddSnippet(263, "Calibre nmLVS can reduce built-in or generic, user-defined devices through the LVS Reduce statement. Other statements exist for reduction of specific types of devices in certain connection configurations (parallel, series, and split gate).");
MGCAddSnippet(264, "Parallel MOS transistors are reduced by default during comparison of built-in MOS devices.");
MGCAddSnippet(265, "Series MOS transistors are not reduced by default during comparison of built-in MOS devices. ");
MGCAddSnippet(266, "Semi-series MOS transistor reduction is not performed by default.");
MGCAddSnippet(267, "Split-gate MOS structures are reduced by default during comparison of built-in MOS devices.");
MGCAddSnippet(268, "Series-parallel device reduction is a generalization of regular split-gate reduction. It differs from the regular split-gate reduction in that the parallel structures contained in transistor strings are also collapsed. ");
MGCAddSnippet(269, "Semi-split gate reduction is enabled by the SEMI ALSO option of the LVS Reduce Split Gates statement. ");
MGCAddSnippet(270, "The SAME ORDER option of the LVS Reduce Split Gates specification statement specifies that split gates should be collapsed only when the input order is the same for all strings of transistors that form the split gate.");
MGCAddSnippet(271, "The WITHIN TOLERANCE option of the LVS Reduce Split Gates specification statement indicates that split structures should not be reduced if they violate the tolerances in any pertinent LVS Split Gate Ratio specification statements. When WITHIN TOLERANCE is specified, split gate reduction does not occur if it would have resulted in an LVS Split Gate Ratio discrepancy.");
MGCAddSnippet(272, "The MIX TYPES option of the LVS Reduce Split Gates specification statement specifies that a split gate structure may contain transistors with different component types, different numbers of pins, different pin names, or different pin swappability. However, component types, numbers of pins, pin names, and pin swappability, as well as component subtypes, must still be the same in each group of transistors that are collapsed together (that is, in each  row  of the split gate).");
MGCAddSnippet(273, "Certain arrangements of devices are ambiguous for split-gate reduction.");
MGCAddSnippet(274, "Parallel capacitor reduction is performed by default during comparison of built-in capacitors.");
MGCAddSnippet(275, "Series capacitor reduction is performed by default during comparison of built-in capacitors.");
MGCAddSnippet(276, "Parallel resistor reduction is performed by default during comparison of built-in resistors.");
MGCAddSnippet(277, "Series resistor reduction is performed by default during comparison of built-in resistors.");
MGCAddSnippet(278, "Parallel diode reduction is performed by default during comparison of built-in diodes.");
MGCAddSnippet(279, "Parallel bipolar transistor reduction is performed by default during comparison of built-in transistors.");
MGCAddSnippet(280, "Under certain conditions, Calibre nmLVS may assign  missing  or  unknown  values to properties during device reduction. This may occur during effective property calculation, using either built-in or user-defined effective property calculation formulas, and using either built-in or generic device reduction specification statements.");
MGCAddSnippet(281, "By default, comparison of string properties is case-insensitive. ");
MGCAddSnippet(282, "Device reduction programs may appear in the LVS Reduce family of specification statements.");
MGCAddSnippet(283, "The device reduction statements listed here allow you to limit or prevent reduction of devices that have different property values.");
MGCAddSnippet(284, "Calibre nmLVS allows you to filter out devices during circuit comparison. This allows devices in certain configurations to be ignored. Specification statements in the LVS Filter family control this behavior. Device filtering occurs after reduction in LVS comparison.");
MGCAddSnippet(285, "Calibre nmLVS can internally filter unused MOS transistors from source and layout circuits. Filtering is performed only for properly formed MOS transistors. ");
MGCAddSnippet(286, "Calibre nmLVS can internally filter unused bipolar transistors from the source and layout circuits. Bipolar filtering is useful for verifying gate-array layouts. ");
MGCAddSnippet(287, "Nets are classified and handled in various contexts in LVS and are reported accordingly.");
MGCAddSnippet(288, "Supply net names are user-specified in the rule file.");
MGCAddSnippet(289, "Isolated nets are nets that are not connected to any instances or to ports of cells on which LVS operates. Isolated layout and source nets that do not have user-given names in both compared circuits do not cause discrepancies. Named isolated nets are reported throughout the design by default, and, in the top cell, always participate in LVS comparison.");
MGCAddSnippet(290, "A passthrough net is a net that is connected to a port and possibly a pin, but nothing else.");
MGCAddSnippet(291, "Feedthrough nets are nets that connect two pins of a cell together, which connect two nets above these pins together. This is sometimes referred to as a deep short. In the context of Calibre nmLVS, this term is used in the circuit extraction context rather than the LVS comparison context.");
MGCAddSnippet(292, "A trivial net in circuit comparison is a net that is connected only to a port (that is, going up the hierarchy) or only to a pin (that is, going down the hierarchy). ");
MGCAddSnippet(293, "Calibre nmLVS recognizes logic gates and semi-gates (pullup and pulldown structures and other series-parallel logic gates) in transistor-level circuits.");
MGCAddSnippet(294, "To enable tolerance-based checking, you must specify the LVS Recognize Gates WITHIN TOLERANCE keyword. You must also use either the ALL or SIMPLE keyword. You can also use the CELL LIST option to control logic gate recognition based on cell names.");
MGCAddSnippet(295, "Logic injection is enabled by default in Calibre nmLVS-H. ");
MGCAddSnippet(296, "Calibre nmLVS matches individual transistors in logic gates based on their gate pin connections (transistor pin name G), and all gate types are matched.");
MGCAddSnippet(297, "Regular CMOS gates are recognized by default. Specific topologies are shown for each gate type.");
MGCAddSnippet(298, "Regular NMOS gates are recognized by default. Specific topologies are shown by gate type.");
MGCAddSnippet(299, "LDD devices are MOS transistors with non-swappable source and drain pins. There are five types of LDD devices: LDDN, LDDP, LDDE, LDDD, and LDD corresponding to the four regular MOS transistor types: MN, MP, ME, MD, and M.");
MGCAddSnippet(300, "X+ devices are MOS transistors with component subtypes that begin with the letter X or x followed by at least one other character. Note that if the subtype consists of only one character, X, then the transistor is not an X+ device.");
MGCAddSnippet(301, "You can check the physical order of connections to logic gate inputs, including the physical order of parallel device groups. ");
MGCAddSnippet(302, "LVS comparison allows the order of connections to logically equivalent pins of layout instances to differ from the order of connections to the corresponding pins of the corresponding source instances. This is sometimes referred to as pin swapping.");
MGCAddSnippet(303, "Calibre nmLVS compares (traces) the values of selected properties on layout instances to the values of corresponding properties on corresponding source instances. Discrepancies are reported when these values are different. ");
MGCAddSnippet(304, "The Calibre nmLVS circuit comparison module recognizes certain property names as built-in properties for the purpose of device reduction and for other processing. ");
MGCAddSnippet(305, "Calibre nmLVS automatically reads from the input database L properties if they are required for the calculation of effective W values during device reduction. When required, L properties are read even when they are not traced themselves. ");
MGCAddSnippet(306, "The  M  property represents a multiplier factor and can be traced in SPICE netlists. It is available for tracing in all built-in SPICE elements (R, C, L, D, Q, J, M, V) as well as in primitive subcircuit calls (X calls referencing empty subcircuits) and LVS Box subcircuit calls (X calls referencing subcircuits that are designated as LVS Box elements). ");
MGCAddSnippet(307, "Calibre nmLVS-H is a hierarchical LVS application. Calibre nmLVS-H maintains design hierarchy and exploits this hierarchy to reduce processing time, memory use, and LVS discrepancy counts. ");
MGCAddSnippet(308, "The term hcell stands for hierarchically corresponding cell. Hcells are cells that exist in both the layout and source designs and that (presumably) perform the same function. Calibre cannot determine if cells are identical in function because mask layout formats or SPICE netlists do not contain such information. Also, simply because two cells may have the same name is not necessarily a guarantee they have the same topology or device properties. So the user must specify cell correspondence in hierarchical LVS flows.");
MGCAddSnippet(309, "Cell correspondence between layout and source is defined in an hcell list. An hcell list has layout cell names in the left column with corresponding source cell names in the right column.");
MGCAddSnippet(310, "Hcells are compared as hierarchical entities. For each pair of hcells, the layout cell is compared to the paired source cell. All other cells are expanded in the circuit comparison stage down to the next level of hcells (or down to primitive devices when there are no lower-level hcells). ");
MGCAddSnippet(311, "This report shows which hcells were matched and how, which hcells were rejected and why, and is useful for hcell list optimization for the input designs in a hierarchical LVS run.");
MGCAddSnippet(312, "Some hierarchical layer operations preserve the original layout hierarchy (although not necessarily completely). Others can cause hierarchical degradation. The use of layer operations that degrade hierarchy should be avoided in the derivation of device seed layers.");
MGCAddSnippet(313, "Cell pushdown is an optimization in the hierarchical database constructor that pushes cell placements down into underlying cells. This often provides significant performance benefits. However, in Calibre nmLVS-H, it is sometimes desirable to prevent the pushdown of certain cells, such as cells that contain devices. ");
MGCAddSnippet(314, "Calibre nmLVS-H uses hierarchically corresponding cells (hcells) in the layout and source to manage the hierarchical structure during the run. Corresponding hcells are compared and discrepancies are reported at the cell level.");
MGCAddSnippet(315, "Pins of hierarchically corresponding cells (hcells) do not have to be texted, but it is recommended to do so. Untexted hcell pins not uniquely matched within the cell are matched by context. In other words, nets and instances at higher levels of hierarchy can be matched first. This can cause specific matching of pins, nets, and instances within cells at lower levels of hierarchy. Pin texting often improves run time in the circuit comparison module, and it improves ease of interpreting discrepancies.");
MGCAddSnippet(316, "In certain cases, information about the logical equivalence of pins can be carried up from a device, logic gate, or injected component level to respective pins of a containing hcell. The respective hcell pins are then logically equivalent, or  swappable,  as well. This is called trivial pin swappability. Specifically, hcell pins connected directly to swappable pins of a primitive device, logic gate, or injected component within the hcell are swappable, provided that they are not connected to anything else within the hcell. ");
MGCAddSnippet(317, "An LVS box cell is one that is verified only to the level of its ports (or pins, when placed as an instance). The internal structures of a box cell are not verified. ");
MGCAddSnippet(318, "High-short resolution is a process used in Calibre nmLVS-H when processing connectivity information. It is applied to increase performance and capacity and to allow correlation between layout and source designs. ");
MGCAddSnippet(319, "Calibre nmLVS-H recognizes the common SRAM bit-cell structure. As a result, hierarchical LVS allows you to swap certain hcell pins in memory designs.");
MGCAddSnippet(320, "By default, the SPICE netlist reader in Calibre nmLVS-H flattens all parameterized subcircuits. A subcircuit is parameterized if it has at least one subcircuit call that references it and that specifies parameter values. The subcircuit is parameterized regardless of whether those parameters are actually used within the subcircuit. ");
MGCAddSnippet(321, "Logic injection is an algorithm in hierarchical circuit comparison that is designed to reduce memory consumption by replacing common logic circuits with new, primitive elements. ");
MGCAddSnippet(322, "From the user s perspective, components created by logic injection behave largely like logic gates. Injected components appear in the LVS Report in each cell where injection takes place. They are listed similarly to logic gates in the NUMBERS OF OBJECTS AFTER TRANSFORMATION section, and also in the INFORMATION AND WARNINGS section where counts of matched and unmatched instances are given. All injected components have predefined names that start with an underscore (_).");
MGCAddSnippet(323, "An injected-component instance is identified in the LVS report by its type, in parentheses ( ), followed by a list of individual device instances forming the injected component. Component types and optional subtypes of the individual devices are indicated as well. ");
MGCAddSnippet(324, "An injected-component instance pin is identified in the LVS Report by the injected-component type, in parentheses ( ), followed by a colon (:), followed by the injected-component pin name. This is followed by a list of the individual device instances connected to that pin within the injected component. Each individual device instance is identified by the device instance name, followed by a colon (:), followed by the name of the device pin that leads to that injected-component pin. In MOS transistors, the string  s/d  may be shown in the pin name field. This stands for  either source or drain pin.  ");
MGCAddSnippet(325, "This type of discrepancy indicates a missing injected-component instance in the layout or source circuit. This is similar to the  missing instance  discrepancy, except that it is reported for instances of injected components. ");
MGCAddSnippet(326, "An unmatched injected instance is an injected-component instance in the layout or source that cannot be matched to a corresponding injected component in the other circuit and cannot be classified as any of the available discrepancy types.");
MGCAddSnippet(327, "Logic injection and logic gate recognition are unrelated transformations. They can be enabled and disabled separately, and serve different purposes. ");
MGCAddSnippet(328, "Internal nets in injected circuits are nets that are not connected to the pins of the injected component. These nets are removed from the design, along with the original devices. However, unlike the original devices, the internal nets are not matched, and are not reported in cross-reference databases.");
MGCAddSnippet(329, "Some of the circuits injected by logic injection have intrinsic topological symmetry, for example, SRAM bit structures. For such circuits, components created by logic injection have swappable pins. As a result, primitive devices with different component types, subtypes, and properties can be matched to each other, if such matching is required by the connectivity. That is, asymmetry in types, subtypes, and properties does not prevent pin swappability of injected components.");
MGCAddSnippet(330, "In injected component descriptions that follow, CMOS P-type transistors are component type MP and equivalent types indicated with LVS Device Type specification statements. CMOS N-type transistors are component type MN and equivalent types indicated with LVS Device Type specification statements.");
MGCAddSnippet(331, "A two-inverter core of an SRAM bit structure is recognized and injected, but only if it did not form part of a full bit structure.");
MGCAddSnippet(332, "A standard SRAM bit structure is recognized and injected.");
MGCAddSnippet(333, "Rows of SRAM bit cells with shared BL and BR pins are recognized and injected. This is known as a metainjected structure because it contains the bit structure, which is itself injected.");
MGCAddSnippet(334, "An inverter is recognized and injected, but only if it does not form part of a more complex structure, such as a bit structure.");
MGCAddSnippet(335, "Chains of inverters are recognized and injected. This is known as a metainjected structure because it contains the inverter structure, which is itself injected.");
MGCAddSnippet(336, "Series gates are recognized and injected, unless they form a part of some other injected structure, such as NAND or NOR gates, or can potentially form a part of a complex gate, and gate recognition is enabled through the LVS Recognize Gates statement in your rule file. Gates with an arbitrary number of input pins are recognized and injected. ");
MGCAddSnippet(337, "Parallel gates are recognized and injected, unless they form a part of some other injected structure, such as NAND or NOR gates, or can potentially form a part of a complex gate, and gate recognition is enabled through the LVS Recognize Gates statement in your rule file. Gates with an arbitrary number of input pins are recognized and injected. ");
MGCAddSnippet(338, "NAND and NOR gates are recognized and injected, unless they can potentially form a part of a complex gate, and gate recognition is enabled. ");
MGCAddSnippet(339, "Multiplexers based on a transmission gate multiplexer (TGM) structure are recognized and injected.");
MGCAddSnippet(340, "XOR gates based on a TGM structure are recognized and injected. ");
MGCAddSnippet(341, "A 4-MOS Transmission Gate Multiplexer (TGM) is recognized and injected.");
MGCAddSnippet(342, "The Register File Bit (RFB) structure is recognized and injected.");
MGCAddSnippet(343, "Calibre nmLVS and Calibre nmLVS generate an LVS Report along with various other results files such as a circuit extraction report and any requested results databases. The run transcript also has useful information for interpreting results.");
MGCAddSnippet(344, "The LVS transcript is similar in many respects to those written by all Calibre batch tools. ");
MGCAddSnippet(345, "The hierarchical circuit extraction run transcript has certain features unique to it that you should be aware of.");
MGCAddSnippet(346, "The LVS circuit comparison transcript has certain features you should be aware of.");
MGCAddSnippet(347, "When circuit extraction is run together with LVS comparison and hyperscaling is enabled (‑hyper cmp command line option), then the complete transcript of the comparison portion of the run is written to a file called lvs_report_name.log, where lvs_report_name is taken from the LVS Report specification statement.");
MGCAddSnippet(348, "The circuit extraction report is written during the circuit extraction phase. This report contains a summary of circuit extraction warnings and errors that appear in the transcript or in the extracted layout netlist. ");
MGCAddSnippet(349, "ERC, short isolation, and soft-connection checking are performed during circuit extraction when any of them are enabled. ");
MGCAddSnippet(350, "If LVS Summary Report is specified for a hierarchical comparison run, a summary report is generated, which contains a brief synopsis of the run.");
MGCAddSnippet(351, "The LVS Report contains the results of an LVS run in human-readable text form. ");
MGCAddSnippet(352, "The LVS Report contains information about the LVS run. The contents are similar for hierarchical and flat runs, but in flat runs all results are from the top-level cell perspective only.");
MGCAddSnippet(353, "The LVS Report is useful for understanding discrepancies in the design. Read it with the following things in mind.");
MGCAddSnippet(354, "The LVS Report can contain a number of different types of errors and warnings.");
MGCAddSnippet(355, "The overall results of the LVS run are listed in the opening portion of the OVERALL COMPARISON RESULTS section of the LVS Report. ");
MGCAddSnippet(356, "Primary messages in the LVS Report indicate the overall result for the design. These messages are also given for each hcell if the run is hierarchical.");
MGCAddSnippet(357, "Secondary messages in the LVS Report, if any, follow the primary comparison status message. Secondary messages appear in the OVERALL COMPARISON RESULTS section, as well as in the CELL COMPARISON RESULTS sections of hierarchical runs.");
MGCAddSnippet(358, "The SPICE syntax check results appear only in reports created with the ‑cl or ‑cs command line options of Calibre nmLVS (SPICE syntax check mode). ");
MGCAddSnippet(359, "The LVS Report uses a number of conventions for listing various objects.");
MGCAddSnippet(360, "The LVS Report contains a number of discrepancy types that are listed in the individual CELL COMPARISON RESULTS sections of the hierarchical report, or at the primary level of the flat report.");
MGCAddSnippet(361, "This section of the LVS Report lists Trace Property specification statements where ABSOLUTE tolerance values were found to be much larger then the actual property values found. This usually means that the tolerance values were specified with the wrong scale or units. ");
MGCAddSnippet(362, "This section of the LVS Report is present only if LVS found component types with different numbers of signal pins or different signal pin names in the layout and source. Note that only primitive component types are reported in this way (for example, primitive devices or LVS Box cells). This is a legitimate error, so it should not be ignored.");
MGCAddSnippet(363, "The DETAILED INSTANCE CONNECTIONS section of the LVS Report provides information about matched instances whose pins are listed as part of discrepancies on nets. For each pair of instances, the information includes: the layout instance, corresponding source instance, nets connected to their pins in the layout and source, respectively, and the corresponding nets in the source and layout, respectively.");
MGCAddSnippet(364, "This section of the LVS Report contains a list of badly formed power or ground names. A power or ground name is badly formed if it is classified as a non-user-given net name by LVS criteria in both layout and source. ");
MGCAddSnippet(365, "This section appears in the LVS Report if a cycle is found in the cell hierarchy. The cell hierarchy consists of the layout and source hierarchies as well as cell correspondence information. Cycles in the cell hierarchy are global errors that cause LVS-H to abort prior to the comparison stage.");
MGCAddSnippet(366, "This section of the LVS Report lists errant substrate connections.");
MGCAddSnippet(367, "Input errors appear in two sections of the LVS report: LAYOUT INPUT ERRORS and SOURCE INPUT ERRORS. These types of errors must be rectified or comparison will abort or give an INCORRECT status.");
MGCAddSnippet(368, "This section of the LVS Report indicates an instance of a cell with extra pins that are not floating in the layout or source. The extra pins are induced by connections between elements in one design that are not present in the other. This condition is a legitimate error and should be fixed.");
MGCAddSnippet(369, "These sections of the LVS Report detail discrepancies in instance, port, and net names.");
MGCAddSnippet(370, "This section of the LVS Report indicates an instance with different property values in the layout and source.");
MGCAddSnippet(371, "Unmatched objects in the LVS Report are nets, ports, instances, and internally generated logic gates in the layout or source that cannot be matched to corresponding elements in the other circuit and cannot be classified as any of the available discrepancy types. Unmatched objects are reported when there are elements of similar type in the other circuit that have similar connections, but LVS cannot make a decision because of a discrepancy nearby.");
MGCAddSnippet(372, "The INFORMATION AND WARNINGS section of the LVS Report provides messages about conditions that are out of the ordinary but are not considered errors, and about additional information that can be useful in verifying a design. ");
MGCAddSnippet(373, "The detailed error analysis functionality is enabled using LVS Report Option FX in the rule file. When detailed error analysis is enabled, Calibre nmLVS performs additional analysis of discrepancies between layout and source. ");
MGCAddSnippet(374, "Bad instance connections are detected when a layout instance pin is connected to a wrong net. ");
MGCAddSnippet(375, "Bad instance pairs are detected when a pair of instances in series is incorrectly connected.");
MGCAddSnippet(376, "Circular connections are detected when several layout instances are incorrectly connected in a cyclical fashion. ");
MGCAddSnippet(377, "This error is detected when there is a combination of layout cross-connections and pin-swapping. ");
MGCAddSnippet(378, "Cross-connects are detected when two layout nets are interchanged to two instances. ");
MGCAddSnippet(379, "Logic gate bulk pin errors are detected when a layout bulk pin of a logic gate is connected to the wrong net. ");
MGCAddSnippet(380, "Logic gate supply errors are detected when a layout supply pin of a logic gate is connected incorrectly. If the correct layout nets can be identified, they are listed in the fix suggestion. Otherwise, the report refers to a  missing net  and gives the corresponding source net. This error is detected only when logic gate recognition is enabled. ");
MGCAddSnippet(381, "Net connection errors are detected when a layout net is connected to the wrong instance pin. ");
MGCAddSnippet(382, "Open circuit detailed reports are written when two layout nets match one source net.");
MGCAddSnippet(383, "This error is caused by an incorrectly connected layout pin, possibly combined with an open circuit error.");
MGCAddSnippet(384, "This error is caused by an incorrectly connected layout pin, possibly combined with a short-circuit error.");
MGCAddSnippet(385, "Pin connection errors are detected when a layout net is connected to a different pin of the same instance than in the source. ");
MGCAddSnippet(386, "Pin swap errors are reported when two layout pins of an instance are cross-connected.");
MGCAddSnippet(387, "Short circuit detailed reports are written when two source nets match one layout net.");
MGCAddSnippet(388, "This kind of report is written only from the ‑cl and ‑cs command line options of Calibre nmLVS-H (SPICE syntax check mode). ");
MGCAddSnippet(389, "Calibre LVS applications can generate Mask SVDB Directory (commonly called SVDB) instance and net cross-reference files. These are useful in identifying layout and source object correspondence.");
MGCAddSnippet(390, "The instance and net cross-reference files, and the source and layout placement hierarchy files created in the SVDB directory begin with SVDB header lines. This header identifies the type of file and the source of the information used to create that file. Each line begins with the string  # SVDB: . ");
MGCAddSnippet(391, "You can use the Calibre -ixf command line switch to generate flat instance cross-reference files. ");
MGCAddSnippet(392, "The Calibre -nxf command line option instructs LVS to generate a flat net cross-reference file. The NXF secondary keyword of the Mask SVDB Directory specification statement also creates a net cross-reference file within the SVDB directory.");
MGCAddSnippet(393, "The comparison stage of Calibre nmLVS-H creates hierarchical instance and net cross-reference files when the rule file specifies the Mask SVDB Directory specification statement. These files establish layout-to-source correspondence in Calibre RVE and Calibre xRC applications.");
MGCAddSnippet(394, "The comparison stage of Calibre nmLVS-H creates source placement hierarchy (sph) and layout placement hierarchy (lph) files when the rule file specifies the Mask SVDB Directory specification statement. The files establish layout-to-source correspondence in Calibre RVE, Query Server, and Calibre xRC applications, and are in ASCII format.");
MGCAddSnippet(395, "The BPF database provides an interface from flat Calibre nmLVS to external tools. It provides access to shapes on layers involved in circuit extraction and device recognition, and to some other related information. You create the BPF database with the -bpf command line option in flat LVS (-lvs with no -flatten option). You cannot create the BPF database in Calibre nmLVS‑H. ");
MGCAddSnippet(396, "The LVS mask results database is optional and is specified by the Mask Results Database rule file statement. It is used in ICtrace only and cannot be loaded into Calibre RVE. This database is not related to the Standard Verification Database (SVDB) and is not used in Calibre-only flows.");
MGCAddSnippet(397, "A SPICE netlist serves as a source of connectivity information for hierarchical or flat verification for various Calibre tools that process such netlists. Calibre tools support a subset of SPICE 2 syntax with extensions. Some of these extensions are proprietary to Calibre, and some coincide with selected ELDO, HSPICE, or Cadence CDL constructs.");
MGCAddSnippet(398, "Certain syntactical conventions are used for SPICE that are distinct from the syntax conventions used elsewhere in the book.");
MGCAddSnippet(399, "Unless indicated otherwise, all SPICE names, identifiers, and keywords are case-insensitive. This includes node names, element names, subcircuit names, parameter names, and scaling factors. ");
MGCAddSnippet(400, "Any characters not listed as restricted are allowed for names. ");
MGCAddSnippet(401, "Numeric values can take a number of forms and can employ scale factors.");
MGCAddSnippet(402, "Arithmetic expressions can appear anywhere a number can appear. Valid arithmetic operators are: +, -, *, and /. Standard operator precedence in the order of operations is observed, with parentheses ( ) having the highest precedence. The sqrt() function is permitted and returns the positive square root of its argument. Parameter names can be used within arithmetic expressions. Arithmetic expressions can be enclosed in single quotes, but this is not mandatory. ");
MGCAddSnippet(403, "Lines that start with an asterisk (*) or a dollar sign ($) are treated as comments. The $ may also be used to start comments later in a line, but this is not true for *.");
MGCAddSnippet(404, "The Calibre SPICE netlister uses two types of comment-coded extensions to extend the basic SPICE syntax: *. extensions and $ extensions. The *. extensions add entire statements to the language. The $ extensions add new fields to existing SPICE statements. ");
MGCAddSnippet(405, "The Calibre SPICE parser supports character-string parameters in addition to standard SPICE numerical parameters. ");
MGCAddSnippet(406, "By default, the SPICE parser does not process inline parameter references. ");
MGCAddSnippet(407, "Some tools netlist various types of devices with an X letter prefix instead of the letter preferred by SPICE, for example, a MOSFET named XMOS1. The primitive devices perform scaling (using .OPTION SCALE) and other operations on their parameters, but these operations are lacking in the X-instantiated devices. ");
MGCAddSnippet(408, "The Calibre SPICE netlister lists cell names that begin with a dollar sign ($) with leading underscore characters. Usually, the netlister adds two leading underscores and may add additional underscores to avoid conflicts with user cell names. ");
MGCAddSnippet(409, "The SPICE netlister annotates each extracted device instance in the netlist with a number that identifies the associated rule file Device operation. These identifiers are coded as comments in the form $D=<number>. ");
MGCAddSnippet(410, ".SUBCKT statements in an extracted layout netlist are each followed with a comment line containing statistics about the respective layout cell. ");
MGCAddSnippet(411, "The Calibre SPICE parser reports errors or warnings for various incorrect usages in a SPICE netlist. For warnings that could be repeated for multiple instances of an incorrect usage, the parser stops reporting the condition after 256 instances are found. Any error or warning conditions should be understood and fixed as necessary.");
MGCAddSnippet(412, "Calibre tools observe certain control statements in the SPICE netlist. Some of these statements are unique to Calibre SPICE. Others may be recognized by third-party tools. Control statements used in other SPICE dialects than Calibre, and that are ignored, are indicated as such.");
MGCAddSnippet(413, "The *.BUSDELIMITER SPICE statement specifies the character that identifies the index portion of SPICE pin names. The indexed pins indicate the SPICE equivalent of a Verilog port specified with a range expression. The *.BUSDELIMITER statement supports flows that have multiple SPICE subcircuits using different bus delimiter character conventions, which are being called from the same higher-level Verilog structural netlist. Only port names for called SPICE subcircuits are affected by the *.BUSDELIMITER statement.");
MGCAddSnippet(414, "Indicates a condition in a subcircuit that is tracked by Calibre. The specific condition is indicated by additional keywords.");
MGCAddSnippet(415, "*.CAPA instructs the tool to ignore capacitor (C) elements in the netlist. It is coded as a comment and has no arguments.");
MGCAddSnippet(416, "Connects nets together. The .CONNECT statement takes two or more node names as arguments and is coded as a comment.");
MGCAddSnippet(417, "*.DIODE instructs the SPICE parser to ignore diode (D) elements in the netlist. It is coded as a comment and has no arguments.");
MGCAddSnippet(418, "The .ENDL statement indicates the end of a .LIB section. Any statements after a .ENDL are ignored, but a valid comment may appear after .ENDL.");
MGCAddSnippet(419, "Indicates the end of a subcircuit (or module). This statement must be the last one for any subcircuit definition. The statement has two forms.");
MGCAddSnippet(420, "Translates existing layout or source object names to new names.");
MGCAddSnippet(421, "Specifies nodes shared globally by all subcircuits. The form *.GLOBAL is coded as a comment and is equivalent to .GLOBAL.");
MGCAddSnippet(422, "Causes the named file to be included in the netlist in the precise location the .INCLUDE statement appears.");
MGCAddSnippet(423, "Controls how the Calibre SPICE parser processes $LDD designators in M elements in SPICE.");
MGCAddSnippet(424, "Defines or references a SPICE library. It comes in two forms.");
MGCAddSnippet(425, "Causes the SPICE parser to interpret uppercase  M  scale factors as  Mega  (1E+6) instead of the usual  milli  (1E-3). Lowercase  m  scale factors are interpreted as milli. The default in the absence of *.MEGA statements is to interpret both uppercase M and lowercase m as milli.");
MGCAddSnippet(426, "Specifies the scale factor for length measurements of device properties. You can specify any option, but Calibre ignores all options except SCALE.");
MGCAddSnippet(427, "Defines parameter names and values. The values override those set in a .SUBCKT or .MACRO statements, or in subcircuit calls.");
MGCAddSnippet(428, "Indicates that seed promotion occurred during hierarchical device recognition in the layout cell represented by the extracted subcircuit. This statement is coded as a comment and takes no arguments.");
MGCAddSnippet(429, "Instructs the SPICE parser to strip the leading character from all names read in after deciding on the device type, but before any further processing. This statement is useful in certain Calibre PERC flows.");
MGCAddSnippet(430, "Supports the E2LVS EDIF converter and similar programs. The keyword XPINS stands for explicit pin connections. ");
MGCAddSnippet(431, "Certain control statements are silently ignored by the SPICE parser.");
MGCAddSnippet(432, "SPICE uses element statements to represent circuit components. Most of these components are primitive devices. A subcircuit definition frequently specifies a more complex structure.");
MGCAddSnippet(433, "The following strings define a capacitor.");
MGCAddSnippet(434, "The following strings define a diode.");
MGCAddSnippet(435, "The following strings define a junction gate field effect transistor.");
MGCAddSnippet(436, "The following strings define an inductor.");
MGCAddSnippet(437, "The following strings define a metal-oxide-semiconductor field effect transistor.");
MGCAddSnippet(438, "The following strings define a bipolar junction transistor.");
MGCAddSnippet(439, "The following strings define a resistor.");
MGCAddSnippet(440, "The following string defines a voltage source.");
MGCAddSnippet(441, "Subcircuits are written by the hierarchical SPICE netlister for hcells, regular LVS Box cells, and cells created by the hierarchical database constructor (ICV_* cells). If the tool is run with the ‑flatten option, then there is only one subcircuit.");
MGCAddSnippet(442, "Strings beginning with X, having pin names, and referencing a subcircuit definition name constitute subcircuit calls.");
MGCAddSnippet(443, "A subcircuit call may reference fewer pins than specified in the respective .SUBCKT definition; any pins that are not referenced in the subcircuit call are floating. Calibre applications allow floating pins in subcircuit calls. ");
MGCAddSnippet(444, "When assembling a schematic design from several block-level components, some high-level SPICE blocks may use lower-level subcircuits that conflict with block names used by other high-level blocks. Because SPICE cannot distinguish between the calls to the conflicting cells, this situation results in an incorrect instantiation of the first encountered cell for all instances of the conflicting name. ");
MGCAddSnippet(445, "Built-in SPICE elements support a multiplier factor parameter, which is called  m  by default. This parameter is evaluated immediately and is not handed down through parameter passing. ");
MGCAddSnippet(446, "The Calibre SPICE parser supports the Y element used in Eldo. The Y element is another form of the instantiation element X (as in subcircuit calls), but with a different syntax.");
MGCAddSnippet(447, "The V2LVS (Verilog-to-LVS) tool translates a Verilog structural netlist into a SPICE netlist suitable for Calibre nmLVS/Calibre nmLVS-H and Calibre PERC. ");
MGCAddSnippet(448, "V2LVS converts a structural Verilog design into an equivalent netlist in extended SPICE form.");
MGCAddSnippet(449, "An interactive V2LVS Tcl shell session is a good way to understand basic V2LVS usage and to develop scripts.");
MGCAddSnippet(450, "V2LVS supports modules and macro modules. Both are mapped directly into SPICE subcircuits having no exceptions. If a particular module name is declared more than once, the first declaration is used and subsequent declarations are ignored after a warning is issued.");
MGCAddSnippet(451, "Ports declared in Verilog modules are translated to subcircuit ports.");
MGCAddSnippet(452, "Port and bit selections in port references are supported. In this example, module AA uses a port selection [2:3] on the input array TH and a bit selection [4] on the input array UH. SH is a simple array that is used intact as an output array.");
MGCAddSnippet(453, "By default, V2LVS processes undefined modules by attempting to translate them into correct SPICE instances. The tool processes all placements of the undefined module and makes an assumption about port widths from the context of the placements. The assumption is used when writing the SPICE output. ");
MGCAddSnippet(454, "UDP Declarations are treated the same way as behavioral Module declarations; they are used to specify the calling interface of the underlying module. UDPs are ignored in translation (with a warning), but they can be called from other modules. ");
MGCAddSnippet(455, "Ranges of modules are not supported (that is, A an_A[0:1] ( a, b, c );). If a range is encountered on a module instance, a warning is issued and the instance is skipped in translating the module.");
MGCAddSnippet(456, "V2LVS uses calling conventions for modules that have arrays in their port interface.");
MGCAddSnippet(457, "Bit expressions are supported by V2LVS. Special bit values of x and z are not supported and cause termination of the run. ");
MGCAddSnippet(458, "For the case of unnamed concatenation expressions in declarations, ports are unnamed and can only be connected by positional calls.");
MGCAddSnippet(459, "Unconnected pins are uncalled. Instantiations that leave pins uncalled in Verilog do not appear in the output. Calibre nmLVS handles these unconnected pins appropriately. ");
MGCAddSnippet(460, "The following declaration types are meaningful to V2LVS: input, output, inout, all net types, and parameter. ");
MGCAddSnippet(461, "Input, output, and inout declarations are used to determine direction information and port array width in module port interfaces. A parameter declaration can be used to specify range width information. Simple arithmetic and logical expressions may be used in specifying range width information. ");
MGCAddSnippet(462, "V2LVS uses the supply0 and supply1 net types to specify net connections to power and ground nets when numeric values are used for connections. For example, 1'b1 becomes a power connection using the supply1 net name. ");
MGCAddSnippet(463, "Since Verilog is a simulation language and is not generally used to specify power and ground routing, several options are provided to support different power and ground conventions used in different chips.");
MGCAddSnippet(464, "The v2lvs::override_globals ‑custom_override option (command line: -so) allows module- and instance-specific overrides for numeric constant signals in Verilog netlists. This option governs the conversion of numeric constants like 1'b1 and 1'b0 within Verilog netlists. This is implemented through a supply override file.");
MGCAddSnippet(465, "You can add pins or ports using the v2lvs::add_pin command (command line: -addpins).");
MGCAddSnippet(466, "In typical Place and Route (PnR) flows, a SPICE library file for the standard cells is provided by a third-party IP vendor, another group within the production organization, or it could be a part of the design kit from the foundry. Footprints of these standard cells are used in the PnR flow to route at the top level. In the PnR flow, the standard cells are in a black-box format. The Verilog netlist is generated from the PnR tool to fill in the black boxes. Since PnR does not work at the transistor level, it does not have a pin for the bulk connection in the Verilog netlist. ");
MGCAddSnippet(467, "Net assignment initialization creates a connection between two nets using a *.CONNECT statement in SPICE.");
MGCAddSnippet(468, "IEEE Std 1364-2001 describes the use of primitive instances. ");
MGCAddSnippet(469, "All behavioral statements cause the containing module to be skipped in translation, except for the assign statement, which applies continuous assignment. In the translated SPICE, the assign statement is mapped to a *.CONNECT statement to connect one net to another. Net initialization has the same effect as continuous assignment.");
MGCAddSnippet(470, "A Specify block is used to specify timing information for paths across a Verilog module. V2LVS processes $recrem system timing checks in Specify blocks.");
MGCAddSnippet(471, "Expressions are used throughout the Verilog language. V2LVS supports expressions used for structural description. These include things like identifiers; binary, hexadecimal, octal, and decimal numbers; port ranges; port selections; bit selection concatenations; and multiple concatenations.");
MGCAddSnippet(472, "V2LVS supports a limited set of compiler directives.");
MGCAddSnippet(473, "V2LVS can use a Verilog library file to specify declarations to represent leaf modules that are defined in SPICE. V2LVS reads the Verilog library file to gather the port interface names that are used during instantiation. The Verilog library file may contain full Verilog modules, including user-defined primitives and behavioral syntax.");
MGCAddSnippet(474, "SPICE library files may be used to define lower-level modules. V2LVS reads SPICE library files in order to deduce Verilog module interfaces, and to establish appropriate connectivity to SPICE library subcircuits from the V2LVS output netlist.");
MGCAddSnippet(475, "The v2lvs::load_spice -range_mode option (command line: -lsr) causes the SPICE library file to be read for interface information. SPICE pins of the form p[n] are interpreted as Verilog port ranges. Contents of the subcircuits are ignored. Any .INCLUDE statements are processed. Multiple instances of commands using -range_mode are allowed.");
MGCAddSnippet(476, "The v2lvs::load_spice -pin_mode option (command line: ‑lsp) causes the SPICE file to be read for interface information. Pins of the form p[n] are interpreted as individual Verilog ports. Contents of the subcircuits are ignored. Any .INCLUDE statements are processed. Multiple instances of commands using ‑pin_mode are allowed.");
MGCAddSnippet(477, "V2LVS supports a configuration file that allows subcircuit scoping of lower-level SPICE blocks that are incorporated into a top-level Verilog design. ");
MGCAddSnippet(478, "The *.BUSDELIMITER SPICE statement specifies the character that identifies the index portion of SPICE pin names. The indexed pins indicate the SPICE equivalent of a Verilog port specified with a range expression. ");
MGCAddSnippet(479, "The information contained in the Verilog library file is not strictly necessary for mapping Verilog to SPICE. V2LVS implements a number of heuristic algorithms for mapping undeclared module instances to SPICE subcircuits.");
MGCAddSnippet(480, "When a module is instantiated with named ports, connections are made using the $PINS construct supported by Calibre SPICE. ");
MGCAddSnippet(481, "When a module is instantiated with ordered ports, the order in the Verilog instance is assumed to be the same order as the SPICE module definition.");
MGCAddSnippet(482, "When using V2LVS without a Verilog library, there are two situations which can cause undesired results.");
MGCAddSnippet(483, "By default, V2LVS utilizes a Calibre nmLVS comment-coded extension ($PINS) to make pin connections. Such connections are independent of port order in the SPICE. However, the $PINS construct is unique to Calibre flows, and some tools may not recognize it.");
MGCAddSnippet(484, "The v2lvs::create_pex_template command (command line: -t) may be used to generate a file which Calibre xRC can use to determine directions of ports declared in the Verilog netlist.");
MGCAddSnippet(485, "In certain cases, a SPICE library may have numerous .INCLUDE statements that encompass all the netlists of the design. It may be desirable to collect all of these netlists into a single library netlist. The following script performs this function. V2LVS does not need to be part of the tool flow for this script to be useful.");
MGCAddSnippet(486, "The v2lvs::generate_empty_subckts -enable option (command line: –e) generates empty subcircuits from a Verilog library file. This can be useful in conjunction with the LVS Box rule file statement to perform partial comparison of a structural netlist without comparing the low-level circuit descriptions.");
MGCAddSnippet(487, "The V2LVS Tcl interface supports programmability of the Verilog-to-SPICE translation process through standard Tcl language features. The interface has a Tcl pre-processor similar to other Calibre tools. ");
MGCAddSnippet(488, "Most of the Tcl interface commands correspond with command line options from the command line interface.");
MGCAddSnippet(489, "Tcl has a number of foundational ideas that govern all programs.");
MGCAddSnippet(490, "Throughout the command encyclopedia, the brace characters  { }  indicate choices between required options. The bracket characters  [ ]  indicate non-required options. Both of these characters have special meaning in Tcl so it is important not to include these markup characters as part of the literal command syntax in a script.");
MGCAddSnippet(491, "Specifies to add an actual port/pin.");
MGCAddSnippet(492, "Specifies to add a formal port/pin.");
MGCAddSnippet(493, "Adds pins to subcircuit calls and definitions where such pins do not exist in the Verilog or SPICE inputs.");
MGCAddSnippet(494, "Specifies whether to prefer Verilog library pin order over the SPICE library when both refer to the same macro.");
MGCAddSnippet(495, "Specifies whether to write the connection for missing ports.");
MGCAddSnippet(496, "Writes a Calibre xRC source template file.");
MGCAddSnippet(497, "Specifies to read and execute a Tcl script.");
MGCAddSnippet(498, "Creates a list of module names from the input Verilog netlist. When used without any optional argument sets, this command returns a list of all module names.");
MGCAddSnippet(499, "Controls empty .SUBCKT output.");
MGCAddSnippet(500, "Specifies whether pin netlisting uses traditional SPICE rather than $PINS constructs.");
MGCAddSnippet(501, "Returns a list of Verilog `include filenames.");
MGCAddSnippet(502, "Returns a list of port names for a module.");
MGCAddSnippet(503, "Shows the command usage description.");
MGCAddSnippet(504, "Specifies a directory for `include files.");
MGCAddSnippet(505, "Inserts a new instance inside of a given module and assigns an added pin to the instance.");
MGCAddSnippet(506, "Specifies a SPICE library file with translation mode for SPICE pins.");
MGCAddSnippet(507, "Specifies a Verilog structural netlist or library file.");
MGCAddSnippet(508, "Specifies whether unconnected pins receive numbered connections.");
MGCAddSnippet(509, "Overrides an assign statement in a Verilog module with a specified SPICE subcircuit.");
MGCAddSnippet(510, "Specifies handling of global nets, including supply nets.");
MGCAddSnippet(511, "Specifies how backslash (\\) characters are handled in escaped identifiers.");
MGCAddSnippet(512, "Resolves duplicate subcircuit names in SPICE libraries.");
MGCAddSnippet(513, "Specifies array delimiters.");
MGCAddSnippet(514, "Specifies a configuration file that allows scoping of lower-level SPICE blocks incorporated into the top-level Verilog design.");
MGCAddSnippet(515, "Specifies a SPICE netlist to be referenced in a .INCLUDE statement in the output.");
MGCAddSnippet(516, "Specifies that gate-level primitives receive a prefix.");
MGCAddSnippet(517, "Specifies a prefix to add to unnamed pin connections in module instantiations, and to unnamed primitive and gate instantiations.");
MGCAddSnippet(518, "Specifies the verbosity of debug messages issued by the tool.");
MGCAddSnippet(519, "Specifies the verbosity of warning messages issued by the tool.");
MGCAddSnippet(520, "Controls output of instance properties. One of the three required arguments must be specified.");
MGCAddSnippet(521, "Specifies character substitutions.");
MGCAddSnippet(522, "Specifies the Verilog version in use.");
MGCAddSnippet(523, "Specifies whether to treat warnings as errors.");
MGCAddSnippet(524, "Specifies whether to write informational comments to the output SPICE netlist.");
MGCAddSnippet(525, "Specifies to output a translated SPICE netlist of the input Verilog design. Optionally specifies the name of a consolidated SPICE library file.");
MGCAddSnippet(526, "Specifies whether to write *.PININFO comments to the output netlist.");
MGCAddSnippet(527, "The V2LVS command line interface performs two levels of parsing before generating an output SPICE file. In the first pass, a database is created and only interfaces for the Verilog modules are parsed. In the second pass, the complete module structure is parsed and converted from Verilog to SPICE.");
MGCAddSnippet(528, "V2LVS supports Verilog-2001 keywords and constructs. Such items may be parsed but are not translated. When this is the case, it is indicated in the table as a parsing support issue.");
MGCAddSnippet(529, "V2LVS command line.");
MGCAddSnippet(530, "The following table is arranged alphabetically by the first non-variable word that appears after the word ERROR: in the error message.");
MGCAddSnippet(531, "The EDIF-to-LVS (E2LVS) program translates an EDIF (Electronic Design Interchange Format) netlist into a SPICE netlist suitable for Calibre nmLVS/Calibre nmLVS-H comparison against a layout. ");
MGCAddSnippet(532, "E2LVS translates a structural EDIF 2 0 0 design into an equivalent SPICE netlist for use as input to Calibre nmLVS/Calibre nmLVS-H. ");
MGCAddSnippet(533, "E2LVS is an EDIF to SPICE translator.");
MGCAddSnippet(534, "EDIF format is different from SPICE in fundamental ways. It is important to understand EDIF syntax and how this is mapped to SPICE.");
MGCAddSnippet(535, "EDIF identifiers contain alphanumeric and underscore (_) characters. An identifier must start with an ampersand (&) if the first character of the identifier is not a letter. A maximum of 255 characters is allowed, exclusive of the ampersand character.");
MGCAddSnippet(536, "The scope of a name in EDIF is always defined by the statement it appears in, such as library, cell, and view statements. The name extends from just after its description to just before the end of the smallest enclosing name scope. Objects are not allowed to have the same name if they are in the same scope. For example, no two cells in the same library can have the same name. However, if two cells are in different scopes, they can have identical names.");
MGCAddSnippet(537, "EDIF arrays describe a number of objects (net, port, or instance) of the same type with the same name. ");
MGCAddSnippet(538, "Many aspects of EDIF syntax are not translated into SPICE because they are irrelevant in SPICE and to Calibre nmLVS. ");
MGCAddSnippet(539, "A principal difference between EDIF and SPICE is that EDIF uses different name scope levels while SPICE names are global. In EDIF, a cell is uniquely identified by its library, cell, and view names. In SPICE, a subcircuit is uniquely identified by its subcircuit name and the number of pins. ");
MGCAddSnippet(540, "The rename statement extends an EDIF name by enabling you to associate a given string with it.");
MGCAddSnippet(541, "The following EDIF elements are translated to SPICE.");
MGCAddSnippet(542, "The EDIF cell statement corresponds to a SPICE subcircuit name.");
MGCAddSnippet(543, "The edif statement contains all the hierarchy and design information transmitted within a file.");
MGCAddSnippet(544, "The EDIF instance statement specifies to include a copy of a previously defined cell view. ");
MGCAddSnippet(545, "The EDIF joined statement is used to specify port connections. ");
MGCAddSnippet(546, "The EDIF net and netBundle statements declare nets and net groups. ");
MGCAddSnippet(547, "The EDIF port and portBundle statements declare ports and port groups. ");
MGCAddSnippet(548, "The EDIF rename statement allows user-defined names to refer to EDIF names. This construct is useful because EDIF identifiers are restricted to alphanumeric characters. ");
MGCAddSnippet(549, "The EDIF status statement provides historical information about the EDIF file. ");
MGCAddSnippet(550, "This section provides a sample EDIF netlist and its SPICE equivalent, as translated by E2LVS.");
MGCAddSnippet(551, "The Rule File Analyzer is used for detailed rule file analysis. In particular, it is used for examining layer derivations and connectivity chains. It supports both SVRF and TVF formats.");
MGCAddSnippet(552, "The analyzer is used to trace layer derivations, layer connectivity, rule check components, and device definitions. ");
MGCAddSnippet(553, "Rule file analyzer commands give information about layers, rule checks, and connectivity and Device operations in a rule file.");
MGCAddSnippet(554, "Writes the derivation trace of all layers used in the specified rule check name. ");
MGCAddSnippet(555, "Writes the definition of the input layer followed by the Connect or Sconnect statements involving the layer.");
MGCAddSnippet(556, "Writes the layer derivation traces for all layers in the Device statement indicated by the number. ");
MGCAddSnippet(557, "When specified without a filename, redirects output to the shell s terminal. When a filename is used, directs output to that file.");
MGCAddSnippet(558, "Writes the complete rule file for the current state of pre-processor statements.");
MGCAddSnippet(559, "Writes a usage message for all commands.");
MGCAddSnippet(560, "Writes the derivation trace of a specified layer.");
MGCAddSnippet(561, "Writes all layers that have more than one layer name assigned in the rule file. A layer has more than one name if all the layer names have identical derivations. The Calibre database constructor detects equivalent layers and optimizes the layer tree so that the layer is created only once. Any name in the group of aliases can be used in the rule file or in the Rule File Analyzer to refer to the layer. ");
MGCAddSnippet(562, "Writes the names of rule checks in the rule file. The optional arguments cause reporting of checks that would be selected in different Calibre invocation modes that support rule checks.");
MGCAddSnippet(563, "Writes all Connect or Sconnect statements in the rule file, along with the rule file name and line number.");
MGCAddSnippet(564, "Writes all Device statements in the rule file, along with an ordinal number of each statement, the associated rule file name, and the line number.");
MGCAddSnippet(565, "Lists currently active layer names in the rule file, including aliases. ");
MGCAddSnippet(566, "Exits the Rule File Analyzer.");
MGCAddSnippet(567, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

